import React, { Component } from 'react';
import '../App.css';

class Sidebar extends Component {
  state = {
    showHistory: true,
    showCollection: false
  };
  onClickHistory = () => {
    this.setState({
      showHistory: true,
      showCollection: false
    });
  };
  onClickCollection = () => {
    this.setState({
      showCollection: true,
      showHistory: false
    });
  };
  render() {
    console.log('slidebar', Object.keys(this.props.users[0]));
    return (
      <>
        <div className="historyAndCollection">
          <button onClick={this.onClickHistory}>history</button>
          <button oncClick={this.onClickCollection}>Collection</button>
        </div>
        <div>
          {this.state.showHistory ? <div>showing History</div> : null}
          {this.state.showCollection ? <div>showing Collection</div> : null}
        </div>
      </>
    );
  }
}

export default Sidebar;
